import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { getPlatformScores } from "../api/productApi";
import {
  BarChart, Bar, XAxis, YAxis, Tooltip,
  ResponsiveContainer, RadialBarChart, RadialBar
} from "recharts";

// Platform logoları
const getLogo = (platform) => {
  switch (platform.toLowerCase()) {
    case "trendyol": return "/logos/trendyol.png";
    case "hepsiburada": return "/logos/hepsiburada.png";
    case "n11": return "/logos/n11.png";
    default: return "/logos/default.png";
  }
};

const ProductDetail = () => {
  const { productId } = useParams();
  const [scores, setScores] = useState([]);
  const [productName, setProductName] = useState("");
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    async function fetchData() {
      try {
        const data = await getPlatformScores(productId);
        setScores(data);
        if (data.length > 0) {
          setProductName(data[0].productName || `ID: ${productId}`);
        } else {
          setProductName(`ID: ${productId}`);
        }
      } catch (error) {
        console.error("Skorlar alınırken hata:", error);
      } finally {
        setLoading(false);
      }
    }

    fetchData();
  }, [productId]);

  return (
    <div className="container mt-4">
      <h2 className="text-center mb-5">
        {productName} - Detay
      </h2>

      {loading ? (
        <p className="text-center">Yükleniyor...</p>
      ) : scores.length === 0 ? (
        <p className="text-center text-danger">Skor verisi bulunamadı.</p>
      ) : (
        <div className="row">
          {scores.map((score, index) => (
            <div key={index} className="col-md-4 mb-4">
              <div className="card h-100 text-center p-3 shadow-sm">
                <img
                  src={getLogo(score.platform)}
                  alt={score.platform}
                  style={{ height: 50 }}
                  className="mb-2 mx-auto"
                />
                <h5 className="mb-3">{score.platform}</h5>

                {/* Memnuniyet Radial */}
                <div style={{ width: "100%", height: 200 }}>
                  <ResponsiveContainer>
                    <RadialBarChart
                      cx="50%" cy="50%" innerRadius="70%" outerRadius="90%" barSize={10}
                      data={[{ name: "Memnuniyet", value: score.memnuniyet, fill: "#00C49F" }]}
                      startAngle={90} endAngle={-270}
                    >
                      <RadialBar dataKey="value" />
                      <text
                        x="50%" y="50%"
                        textAnchor="middle"
                        dominantBaseline="middle"
                        style={{ fontSize: "18px" }}
                      >
                        {score.memnuniyet ? `${score.memnuniyet.toFixed(1)}%` : "Yok"}
                      </text>
                    </RadialBarChart>
                  </ResponsiveContainer>
                </div>

                {/* Diğer skorlar */}
                <div style={{ width: "100%", height: 150 }}>
                  <ResponsiveContainer>
                    <BarChart
                      layout="vertical"
                      data={[
                        { name: "Kalite", puan: score.kalite },
                        { name: "Fiyat/Performans", puan: score.fiyatPerformans },
                        { name: "Kargolama", puan: score.kargolama }
                      ]}
                    >
                      <XAxis type="number" domain={[0, 100]} hide />
                      <YAxis type="category" dataKey="name" />
                      <Tooltip formatter={(v) => `${v}%`} />
                      <Bar dataKey="puan" fill="#007bff" />
                    </BarChart>
                  </ResponsiveContainer>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default ProductDetail;
